  [],\n\t\"revision_timestamp\": \"2016-07-27T22:19:56.021450\",\n\t\"name\": \"currituck-national-wildlife-refuge-comprehensive-conservation-plan\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on Currituck NWR for the next 15 years. This plan
  outlines the Refuge vision and purpose and describes how Currituck NWR will contribute
  to the overall mission of the Refuge System. The plan provides an introduction to
  the Refuge, an overview of the CCP process, and information about the management
  direction and plan implementation. Key planning issues include: global warming,
  sea level rise, fish and wildlife populations, habitats, public use, resource protection,
  and general administration.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
